import React from "react";

const Searchbar = ({ keyword, setKeyword }) => {
  const BarStyling = {
    width: "20rem",
    background: "F2F1F9",
    border: "none",
    padding: "0.5rem",
  };
  return (
    <input
      style={BarStyling}
      key="random1"
      value={keyword}
      placeholder={"search country"}
      onChange={(e) => setKeyword(e.targetvalue)}
    />
  );
};

export default Searchbar;
